span.span:
与内置类型一致的读写：
std::string s1, s2;
std::cin >> s1 >> s2;
std::cout << s1 << s2 << std::endl;

std::string line;
std::getline(std::cin, line); 
// 每次读入一整行直至EOF

while(std::getline(std::cin, line))
    if (!line.empty())
        std::cout << line <<std::endl;

while(std::getline(std::cin, line))
    if (!line.size() > 80)
        std::cout << line <<std::endl;

size_type类型可以通过auto来忽略：
auto len = line.size();
或者用decltype来阐明：
decltype(line.size()) len = line.size();

按照字典顺序（即编码值）比较：
string str = "Hello";
string str1 = "Hello World";
string str2 = "Hiya";

与内置类型一致：
string st1(10, 'c'), st2;
st1 = st2;

得到一个新的string对象：
string s1 = "Hello, ", s2 = "World";
string s3 = s1 + s2;

vector<int> ivec;    // ivec保存了int类型的对象
vector<Sales_item> Sales_vec;    
// 保存自定义类型的对象
vector<vector<string>> file;    // 保存vector对象

vector<string> v7{10};     
// 首先尝试列表初始化，失败后转默认值
// 结果是v7有10个默认初始化的元素

vector<string> v7{10, "hi"};
// 首先尝试列表初始化，失败后转默认值
// 结果是v7由十个值为"hi"的元素

a[d]:
a是数组的名字;
d是数组的维度, 必须大于0,必须是常量表达式

使用数组作为一个auto变量的初始值时, 推断得到的类型是指针而不是数组:
int ia[] = {0,1,1,2,1,2,}; // ia是整型数组
auto ia2(ia);
// ia2是一个整型指针,指向ia第一个元素

重写迭代器循环:
for (int *b = arr; b != e; ++b)
    cout << *b << endl;

int ia[] = {1,2,3};
int *beg = begin(ia);
int *last = end(ia);

使用数组初始化vector对象:
int int_arr[] = {1,1,1,1,1};
vector<int> Ivec(begin(int_arr), end(int_arr));

const_iterator:
vector<int>::const_iterator it;
string::const_iterator it2;

iterator:
vector<int>::iterator it;
string::iterator it2;

解引用可能会引起误会:
(*it).empty()  
// 正确,解引用it然后调用对象的empty()函数
*it.empty()
// 错误, 试图解引用it的成员函数,很明显是不允许
